import Item from "../Item/Item";

const ItemList = ({ products }) => {
  console.log("products en ItemLIst", products);
  return (
    <>
      
      {products.map((product) => {
        console.log(product);
        return (
        
          <Item
           key={product.id} 
           title={product.title}
           image={product.image}
           descripcion={product.descripcion} 
           price={product.price} />
      
        );
      })}
    </>
  );
};
export default ItemList;
